import TopBarProgress from "react-topbar-progress-indicator";

TopBarProgress.config({
    barColors: {
        "0": "#fff",
        "1.0": "#fff"
    },
    shadowBlur: 5
});

const Loading = () => {
    return <div>{this.state.loading && <TopBarProgress />}</div>;
};

export default Loading;
